import React, { useState } from "react";
import axios from "axios";
import "../sass/todolist.css";
import img_box from "../img/d/profil.png";
import box_chat from "../img/box-chat/db-main-small.png";
import knife from "../img/box-chat/knife.png";

const ShowList = () => {
  const [title, setTitle] = useState("");
  const [description, setDescription] = useState("");

  const fetchData = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post(
        "http://localhost:3001/api/create-list",
        {
          title,
          description,
        },
        {
          withCredentials: true,
        }
      );
      console.log(res);
      if (res === 201) {
        console.log("Succesfull");
      }
    } catch (err) {
      console.log(err);
    }
  };
  return (
    <div className="bg_list">
      <div className="box-wrap"></div>
    </div>
  );
};

export default ShowList;
